const Team = () => {
  return (<Fragment>
    <div className="w-a h-a h-pr-fl-ma centered bg-orange"><div className=" p-a m-a d-a" Style="width: 100px; height: 100px; top: 0px; bottom: 0px; left: -250px; bg-green">asd</div>
    <div className="w-125px h-125px h-pr-fl-ma of-h circle" Style="border: 1px solid; border-color: white;"><div className="w-100 h-100 h-pr-fl-ma bg-red b-s-b-b centered"><span className="w-a h-a h-pr-fl-ma centered ">LOGO</span></div></div>
    </div></Fragment>
  )
}

export default Team
